import "./tractor1.css";
const tractor1 = () => {
  return (
    <div className="coimbatore-t">
      <div className="bg-19-1">
      <h1 className="head">COIMBATORE</h1>
        <div className="button"><div className="rectangle-278">
           <div className="button1"><a class="myButton" href="https://dir.indiamart.com/coimbatore/tractor.html">NEW</a></div>
           <div className="button2"><a class="myButton" href="https://www.tractorjunction.com/used-tractor-in-coimbatore">USED</a></div>
          <div className="button3"><a class="myButton" href="https://www.tradeindia.com/coimbatore/tractors-city-228082.html">DEALER</a></div>
        </div></div>
      </div>
    </div>
  );
};
export default tractor1;
